import {
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import UserService from "../services/user.service";

export default class Home extends Component {

  constructor(props) {
    super(props);

    this.state = {
      content: "Bitch"
    };
  }

  componentDidMount() {
    UserService.getPublicContent().then(
      response => {
        this.setState({
          content: response.data
